import { useEffect, useState } from "react";
import Layout from "../Layout";
import axios from "axios";
import { assets } from "../../Assets/assets";

function BlogLists() {
    const [blogs,setBlogs] = useState("");

    function fetchBlogData() {
        axios.get("http://localhost:8080/show")
        .then((response)=> setBlogs())
    }

    useEffect(()=> {
        fetchBlogData()
    },[blogs])

    return (
        <>
        <Layout/>
        <div id = "admin-bl-div">
            <p>All blogs</p>
            <div id = "admin-bl-inside-div">
                <table>
                    <thead>
                        <tr>
                            <th>AUTHOR NAME</th>
                            <th>BLOG TITLE</th>
                            <th>DATE</th>
                            <th>ACTION</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td>
                                <img src= {assets.profile_icon} width={70}/>
                            </td>
                            <td>
                                {}
                            </td>
                        </tr>
                    </tbody>
                </table>
            </div>
        </div>
        </>
    )
}

export default BlogLists;
